INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(494,'Mid470','2019-10-19 10:47:18','여행의 매력: 새로운 여정, 새로운 경험','일본 여행 일정은 도쿄의 번화가와 오사카의 현대적인 매력, 교토의 전통적인 멋을 경험할 수 있는 특별한 여행입니다. 문화와 맛의 다채로움을 즐겨보세요!','2021-5-3','8박9일','100만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(606,'Mid229','2019-8-9 11:37:42','탐험가들을 위한 완벽한 여행 일정 소개','일본을 여행하는 일정은 후쿠오카의 해안 풍경, 나라의 역사적 명소, 그리고 후지산의 자연 아름다움을 경험할 수 있는 특별한 여행입니다. 다채로운 일본의 매력을 느껴보세요!','2022-5-18','16박17일','10만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(443,'Mid301','2018-1-6 15:23:50','휴양지로 떠나는 여행: 이번 일정을 놓치지 마세요','일본 여행 일정은 긴 옛 전통과 현대의 아름다움이 공존하는 도시, 오사카, 나라, 그리고 후지산의 풍경을 담고 있어요. 역사와 자연의 조화를 느껴보세요!','2022-10-13','28박29일','100만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(1471,'Mid480','2020-6-29 22:22:32','자연 속으로: 새로운 여행 일정 소식','일본 여행 일정은 오사카의 흥겨운 번화가, 교토의 고요한 절경, 후지산의 황량한 자연을 경험할 수 있는 특별한 여행입니다. 다양한 모습의 일본을 만나보세요!','2022-10-16','10박11일','100만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(1882,'Mid180','2020-8-11 22:37:44','모험을 꿈꾸는 이들을 위한 여행 일정 소개','일본을 여행하는 일정은 다양한 맛집, 전통적인 문화체험, 아름다운 자연 경관을 담고 있어요. 음식, 문화, 자연의 아름다움을 함께 누려보세요!','2022-5-13','18박19일','300만원 이상');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(32,'Mid247','2018-10-6 12:20:50','추억으로 가는 여행: 새로운 일정이 여러분을 기다립니다','일본 여행 일정은 도쿄의 현대적인 매력, 교토의 고즈넉한 분위기, 나라의 전통적인 아름다움을 경험할 수 있는 특별한 여행입니다. 다양한 일본의 매력을 느껴보세요!','2021-8-6','1박2일','100만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(1537,'Mid484','2020-12-6 23:32:27','여행 중독자를 위한 최신 여정 소식','일본 여행 일정은 도쿄의 도심 문화, 교토의 전통적 풍경, 후지산의 자연 아름다움을 경험할 수 있는 특별한 여행입니다. 다채로운 일본의 아름다움을 만나보세요!','2021-8-2','19박20일','300만원 이상');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(593,'Mid39','2019-5-16 15:34:33','세계 여행을 위한 놀라운 계획','일본을 여행하는 일정은 쇼핑 천국 도쿄, 세계 문화 유산 교토, 자연의 보석 후지산을 담고 있어요. 도시와 자연의 아름다움을 느껴보세요!','2021-3-2','15박16일','10만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(19,'Mid246','2018-7-28 13:34:55','모험가를 위한 세계 일정 소개','일본 여행 일정은 도쿄의 긴 여행과 교토의 전통, 그리고 후지산의 자연 경관을 경험할 수 있는 특별한 여행입니다. 다양한 일본의 매력을 느껴보세요!','2022-12-9','5박6일','200만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(1440,'Mid199','2018-7-11 11:34:42','신나는 여정: 세계를 탐험하다','일본 여행 일정은 역동적인 도쿄, 역사와 전통의 교토, 자연의 아름다움 후지산을 담고 있어요. 일본의 다채로운 모습을 만나보세요!','2022-7-13','27박28일','100만원 이하');
INSERT INTO TRAVEL_INTRODUCTION_POST VALUES(898,'Mid306','2020-2-19 16:15:21','세계 일주: 환상적인 일정 공개','한국 여행 일정은 서울의 도심 문화와 고궁, 부산의 바닷가와 전통 시장을 만나는 특별한 여행입니다. 도시와 자연의 아름다움을 함께 누려보세요!','2022-12-9','3박4일','10만원 이하');
