INSERT INTO TRAVEL_COMPANION_POST VALUES(1360,'Mid73','2019-4-15 15:35:55','즐거운 여행을 함께할 분을 찾습니다','자연을 느끼며 힐링 여행을 즐길 동행자를 찾습니다. 함께 풍경을 감상하며 힐링을 느끼고, 여행의 아름다움을 함께 나누고 싶어요.','2020-3-25','24박25일','200만원 이하','진행','2020-3-30','남','10-20대','남극',3);
INSERT INTO TRAVEL_COMPANION_POST VALUES(1826,'Mid192','2019-5-26 11:27:12','여행 친구를 모집합니다: 함께하는 즐거움','여행 중 함께 관광 명소를 즐길 파트너를 찾습니다. 함께 경험을 나누며 새로운 이야기를 만들고 싶어요!','2020-2-10','6박7일','300만원 이하','진행','2020-2-11','남','10-20대','오세아니아',1);
INSERT INTO TRAVEL_COMPANION_POST VALUES(1783,'Mid418','2019-10-1 13:17:18','동행자를 찾는 여행자','힐링 여행을 좋아하는 분과 함께 자연을 느껴보고 싶어요. 함께 숲속을 거닐며 힐링을 느끼며 여행의 아름다움을 함께 나누고 싶어요.','2021-10-15','7박8일','10만원 이하','진행','2021-10-19','남','20대','남극',3);
INSERT INTO TRAVEL_COMPANION_POST VALUES(1285,'Mid438','2018-5-18 13:12:27','함께 여행할 새로운 친구를 찾습니다','맛있는 음식과 멋진 풍경을 함께 탐방하고 즐길 동행자를 찾습니다. 함께 여행하면서 즐거운 추억을 만들고 사진 찍는 재미를 함께 느끼고 싶어요.','2021-8-4','27박29일','200만원 이하','마감','2021-8-8','여','20-30대','남아메리카',5);
